membership_field:
Who Can Join?
- Employees of the United States Postal Service who work in New Castle County;
- Persons retired by the Federal Government as annuitants from the postal service;
- Employees and Families of Ronnie’s Auto Repair in Newport, Delaware;
- Residents of Tuxedo Park/Westview;
- Members of The Marshallton Civic Association;
- Members of The Civic Association of Belvedere and Vicinity;
- and family members of the above groups, including spouse, children, parents, grandparents, grandchildren, stepchildren, stepparents, siblings, and adopted children.

Big Island Federal Credit Union membership is available to anyone who meets the following criteria:

- Persons who live on the island of Hawaii;
- Persons who regularly work, attend school, worship, perform volunteer services, or participate in associations headquartered on the island of Hawaii;
- Persons participating in programs to alleviate poverty or distress which are located on the island of Hawaii;
- Incorporated and unincorporated organizations located on the island of Hawaii.

MEMBERSHIP ELIGIBILITY

- Permanent Full & Part-time employees of the Department of Education, certified, employed substitute teachers;
- Students attending public schools (and/or their immediate family members) within the Department of Education;
- Contract employees who work regularly for the Department of Education;
- Spouses of persons who died while within the field of membership of this credit union;
- Employees of this credit union, persons retired as pensioners or annuitants from the above employment, and organizations of such persons.
- Immediate family members of a member or potential member may join our credit union. Immediate family members are defined as grandparents, parents, step-parents, siblings, step-siblings, children, adopted children, step-children, and grandchildren. Membership is also open to persons who reside in the same "household" with a member.
- Students and faculty of Hawaii Technology Academy Charter School

All above must be within the County of Maui.

Simply put, HFS Federal Credit Union membership is open to anyone who lives, works or worships on the island of Hawai‘i.

More specifically, membership at HFS FCU is offered to those with the following common bond:

- Persons who live on the island of Hawai‘i
- Persons who regularly work, attend school, worship, perform volunteer service, or participate in associations headquartered on the island of Hawai‘i;
- Persons participating in programs to alleviate poverty or distress which are located on the island of Hawai‘i;
- Incorporated and unincorporated organizations located on the island of Hawai‘i, or maintaining a facility on the island of Hawai‘i;
- Spouse of persons who died while within the field of membership of this credit union;
- Employees of this credit union;
- Members of their immediate families or households; and organizations of such persons.
